(1, 'YbsaNm7LeW4IVt7y1BRJ.png', 'X8gOELu59fLXBobMBJBv.png', '<h2>\r\n\r\n</h2><h1><strong>VISI dan MISI GUBERNUR BALI 2019-2024</strong></h1><p><strong>VISI </strong></p><p><strong><img alt=\"\" src=\"http://103.110.184.44/files/images/nangun.png\"></strong></p><h2><em><strong>“NANGUN SAT KERTHI LOKA BALI” </strong></em></h2><p><strong>Melalui Pola Pembangunan Semesta Berencana Menuju Bali Era Baru</strong></p><p>“Menjaga Kesucian dan Keharmonisan Alam Bali Beserta Isinya, Untuk Mewujudkan Kehidupan Krama Bali Yang Sejahtera dan Bahagia, Sakala-Niskala Menuju Kehidupan Krama dan Gumi Bali Sesuai Dengan Prinsip Trisakti Bung Karno: Berdaulat secara Politik, Berdikari Secara Ekonomi, dan Berkepribadian dalam Kebudayaan Melalui Pembangunan Secara Terpola, Menyeluruh, Terencana, Terarah, dan Terintegrasi Dalam Bingkai Negara Kesatuan Republik Indonesia Berdasarkan Nilai-Nilai Pancasila 1 Juni 1945.”</p><div></div><p><strong>MISI </strong></p><ol><li>Memastikan terpenuhinya kebutuhan pangan, sandang, dan papan dalam jumlah dan kualitas yang memadai bagi kehidupan Krama Bali.</li><li>Mewujudkan kemandirian pangan, meningkatkan nilai tambah dan daya saing pertanian, dan meningkatkan kesejahteraan petani.</li><li>Mengembangkan pelayanan kesehatan masyarakat yang terjangkau, merata, adil dan berkualitas serta didukung dengan pengembangan sistem dan data base riwayat kesehatan Krama Bali berbasis kecamatan.</li><li>Memastikan tersedianya pelayanan pendidikan yang terjangkau, merata, adil, dan berkualitas serta melaksanakan wajib belajar 12 tahun.</li><li>Mengembangkan sistem pendidikan dasar dan pendidikan menengah berbasis keagamaan Hindu dalam bentuk Pasraman di Desa Pakraman/Desa Adat.</li><li>Mengembangkan sumber daya manusia yang berdaya saing tinggi yaitu berkualitas dan berintegritas: bermutu, profesional dan bermoral serta memiliki jati diri yang kokoh yang dikembangkan berdasarkan nilai-nilai kearifan lokal Krama Bali.</li><li>Mengembangkan sistem jaminan sosial secara konprehensif dan terintegrasi bagi kehidupan Krama Bali sejak mulai kelahiran, tumbuh dan berkembang sampai akhir masa kehidupannya.</li><li>Menghasilkan tenaga kerja yang kompeten, produktif, berkualitas dan memiliki daya saing tinggi serta memperluas akses kesempatan kerja di dalam dan di luar negeri.</li><li>Mengembangkan sistem jaminan sosial dan perlindungan tenaga kerja yang komperhensif, mudah dijangkau, bermutu, dan terintegrasi bagi Krama Bali yang bekerja di dalam dan di luar negeri.</li><li>Memajukan kebudayaan Bali melalui peningkatan pelindungan, pembinaan, pengembangan dan pemanfaatan nilai-nilai adat, agama, tradisi, seni, dan budaya Krama Bali.</li><li>Mengembangkan tata kehidupan Krama Bali secara sakala dan niskala berdasarkan nilai-nilai filsafat Sad Kertih yaitu Atma Kertih, Danu Kertih, Wana Kertih, Segara Kertih, Jana Kertih, dan Jagat Kertih.</li><li>Memperkuat kedudukan, tugas dan fungsi Desa Pakraman/ Desa Adat dalam menyelengarakan kehidupan krama Bali yang meliputi Parahyangan, Pawongan, dan Palemahan.</li><li>Mengembangkan destinasi dan produk pariwisata baru berbasis budaya dan berpihak kepada rakyat yang terintegrasi antar kabupaten/kota se-Bali.</li><li>Meningkatkan promosi pariwisata Bali di dalam dan di luar negeri secara bersinergi antar kabupaten/kota se-Bali dengan mengembangkan inovasi dan kreatifitas baru.</li><li>Meningkatkan standar kualitas pelayanan kepariwisataan secara konprehensif.</li><li>Membangun dan mengembangkan pusat-pusat perekonomian baru sesuai dengan potensi kabupaten/kota di Bali dengan memberdayakan sumber daya lokal untuk mendukung pertumbuhan ekonomi dalam arti luas.</li><li>Membangun dan mengembangkan industri kecil dan menengah berbasis budaya (branding Bali) untuk memperkuat perekonomian Krama Bali.</li><li>Meningkatkan pembangunan infrastruktur (darat, laut dan udara) secara terintegrasi serta konektivitas antar wilayah untuk mendukung pembangunan perekonomian serta akses dan mutu pelayanan publik di Bali.</li><li>Mengembangkan sistem keamanan terpadu yang ditopang dengan sumber daya manusia serta sarana prasarana yang memadai untuk menjaga keamanan daerah dan Krama Bali serta keamanan para wisatawan.</li><li>Mewujudkan kehidupan Krama Bali yang demokratis dan berkeadilan dengan memperkuat budaya hukum, budaya politik dan kesetaraan gender dengan memperhatikan nilai-nilai budaya Bali.</li><li>Mengembangkan tata kehidupan Krama Bali, menata wilayah, dan lingkungan yang, hijau, indah, dan bersih.</li><li>Mengembangkan sistem tata kelola pemerintahan daerah yang efektif efisien, terbuka, transparan, akuntabel dan bersih serta meningkatkan pelayan publik terpadu yang cepat, pasti dan murah.</li></ol><p><strong>BIDANG PROGRAM PRIORITAS</strong></p><p>Bidang 1 : PANGAN, SANDANG DAN PAPAN<br>Bidang PANGAN : Arah kebijakan dan program pembangunan yang berkaitan dengan pangan, mulai dari hulu sampai ke hilir berorientasi pada upaya pemenuhan dalam jumlah dan kualitas yang memadai untuk: kebutuhan Krama Bali, kebutuhan para wisatawan, dan berorientasi untuk ekspor.<br>Bidang SANDANG : Arah kebijakan dan program pembangunan yang berkaitan dengan sandang, mulai dari hulu sampai ke hilir berorientasi pada upaya pemenuhan dalam jumlah dan kualitas yang memadai untuk: kebutuhan Krama Bali, kebutuhan para wisatawan, dan berorientasi untuk ekspor.<br>Bidang PAPAN  : Arah kebijakan dan program pembangunan yang berkaitan dengan papan, berorientasi pada upaya pemenuhan dalam jumlah dan kualitas yang memadai untuk: kebutuhan Krama Bali, dan kebutuhan para wisatawan.</p><p>&nbsp;</p><p>Bidang 2 : KESEHATAN DAN PENDIDIKAN<br>BIDANG KESEHATAN :Arah kebijakan dan program pembangunan yang berkaitan dengan kesehatan, berorientasi pada upaya pemenuhan dalam jumlah dan kualitas yang memadai untuk: kebutuhan Krama Bali.<br>BIDANG PENDIDIKAN :Arah kebijakan dan program pembangunan yang berkaitan dengan pendidikan, berorientasi pada upaya pemenuhan dalam jumlah dan kualitas yang memadai untuk kebutuhan Krama Bali</p><p>&nbsp;</p><p>Bidang 3 : JAMINAN SOSIAL DAN KETENAGAKERJAAN<br>Bidang JAMINAN SOSIAL : Arah kebijakan dan program pembangunan yang berkaitan dengan jaminan sosial, berorientasi pada upaya pemenuhan kebutuhan Krama Bali.<br>Bidang KETENAGAKERJAAN : Arah kebijakan dan program pembangunan yang berkaitan dengan ketenagakerjaan, berorientasi pada upaya pemenuhan kebutuhan Krama Bali.<br>Bali perlu fokus pada penyiapan ketenagakerjaan (sumber daya manusia) yang spesifik yaitu: pertanian moderen, pariwisata, industri kreatif berbasis budaya, arsitektur dan desain, pengobatan tradisional, dan SPA.</p><p>&nbsp;</p><p>Bidang 4 : ADAT, AGAMA, TRADISI, SENI DAN BUDAYA<br>Bidang ADAT : Arah kebijakan dan program pembangunan yang berkaitan dengan adat, berorientasi pada keberpihakan (afirmasi) dalam memajukan adat istiadat Krama Bali yang meliputi: pelindungan, pembinaan, pengembangan, dan pemanfaatan adat istiadat Krama Bali.<br>Bidang AGAMA : Arah kebijakan dan program pembangunan yang berkaitan dengan agama adalah sebagai berikut.<br>Bidang KEBUDAYAAN : Arah kebijakan dan program pembangunan yang berkaitan dengan tradisi, seni, dan budaya dari hulu sampai ke hilir, berorientasi pada keberpihakan (afirmasi) dalam memajukan Kebudayaan Bali yang meliputi: pelindungan, pembinaan, pengembangan, dan pemanfaatan tradisi, seni, dan budaya Krama Bali.</p><p>&nbsp;</p><p>Bidang 5 : PARIWISATA<br>Bidang PARIWISATA  : Arah kebijakan dan program pembangunan kepariwisataan berorientasi pada kualitas yang mencakup berbagai aspek yaitu: pengembangan destinasi wisata, produk dan industri pariwisata, promosi dan pemasaran pariwisata, sarana-prasarana pariwisata, pelayanan pariwisata, dan wisatawan mancanegara yang datang ke Bali. Dalam konteks pariwisata berkualitas, yang menjadi sasaran wisatawan adalah: wisatawan yang waktu tinggalnya lebih lama, wisatawan yang berbelanja lebih banyak, wisatawan yang peduli lingkungan dan kebudayaan, wisatawan yang memberdayakan sumber daya lokal (tenaga kerja lokal, komoditas lokal, produk lokal, investasi lokal).</p><p><strong>SEJARAH PEMBENTUKAN BPBD PROVINSI BALI</strong></p><ul><li>Embrio pembentukan BPBD Provinsi Bali diawali dengan pembentukan UPT. Pusdalops PB yang berada di bawah Badan Kesbang Pol dan Linmas Provinsi Bali melalui Perda Nomor 2 Tahun 2008.</li><li>Pembentukan UPT. Pusdalops PB dibantu oleh Palang Merah Perancis (FRC) melalui Kesepakatan Bersama antara Pemerintah Provinsi Bali dengan Palang Merah Perancis tanggal 25 Agustus 2008.</li></ul><p><strong>KELEMBAGAAN  BPBD PROVINSI BALI</strong></p><ul><li>BPBD Provinsi Bali dibentuk dengan Perda Nomor 4 Tahun 2011 tentang Organisasi dan Tata Kerja Perangkat Daerah. Uraian tugasnya ditetapkan dengan Pergub Nomor 52 Tahun 2011.</li><li>BPBD Provinsi Bali mulai diisi personil pada tanggal 18 Januari 2012.</li><li>Keberadaan BPBD tidak menghilangkan/mengurangi peranan lembaga-lembaga lain dalam  Penanggulangan Bencana, melainkan BPBD melaksanakan fungsi koordinasi, komando &amp; pelaksanaan.</li></ul><p><strong>STRUKTUR ORGANISASI BPBD PROVINSI BALI</strong></p><p><img alt=\"\" src=\"http://103.110.184.44/files/images/struktur%20bpbd%20bali.jpg\"></p><p><strong>VISI BPBD </strong><strong>PROVINSI BALI:</strong></p><p><strong>Terwujudnya Penanggulangan Bencana Provinsi Bali secara terencana, terpadu berbasis masyarakat dan teknologi.</strong></p><p>&nbsp;</p><p><strong>MISI BPBD </strong><strong>PROVINSI BALI</strong><strong>:</strong></p><ol><li>Membangun dan meningkatkan sistem Penanggulangan Bencana Provinsi Bali.</li><li>Memperkuat kapasitas dan ketahanan seluruh <em>stakeholder</em>&nbsp;dalam Pengurangan Risiko Bencana.</li><li>Memberikan perlindungan dan jaminan kepada masyarakat melalui pemberdayaan masyarakat.</li><li>Memanfaatkan teknologi secara efektif dalam Penanggulangan Bencana.</li></ol><p>Dalam rangka kesiapsiagaan, BPBD Provinsi Bali memiliki Unit Pelaksana Teknis (UPT) Pusat Pengendalian Operasi Penanggulangan Bencana (Pusdalops PB) beroperasi dengan sistem 24/7 (terus menerus), sehingga kapanpun terjadi bencana akan selalu terpantau.</p><p>&nbsp;</p><p><strong>STRUKTUR ORGANISASI UPTD. PENGENDALIAN BENCANA DAERAH BPBD PROVINSI BALI</strong></p><p><img alt=\"\" src=\"http://103.110.184.44/files/images/Bagan%20UPTD.PNG\"></p><p><strong>FUNGSI UPTD. PENGENDALIAN BENCANA DAERAH BPBD PROVINSI BALI</strong></p><ol><li><strong>PUSAT DATA DAN INFORMASI</strong></li><li><strong>SISTEM PERINGATAN DINI</strong></li><li><strong>OPERASI TANGGAP DARURAT</strong></li><li><strong>PELAYANAN KEGAWATDARURATAN</strong></li></ol>\r\n\r\n<br>', '2019 ©\r\n\r\nAll Copyright Reserved&nbsp;', '<p>\r\n\r\nJalan D.I Panjaitan No. 6 Renon - Denpasar 80235\r\n\r\n</p>', '0361 - 245397', '0361 - 245395', 'bpbdprovbali@gmail.com', 'Badan Penanggulangan Bencana Daerah (BPBD) Provinsi Bali', 'cuaca,gempa,gunung agung,bpbd,bmkg,provinsi bali', 'Gubernur Bali I Wayan Koster memaparkan visi misi dan program pembangunan Bali yang tertuang dalam “Nangun Sat Kerthi Loka Bali” yang mempunyai arti menjaga kesucian dan keharmonisan alam Bali beserta isinya, untuk mewujudkan kehidupan krama dan gumi Bali yang sejahtera dan bahagia pada acara Sidang Paripurna DPRD Prov. Bali serta Serah Terima Jabatan dan Memori Jabatan Gubernur Bali di ruang sidang DPRD Prov. Bali.\r\nDalam acara tersebut ia juga memaparkan tentang janji kampanyenya One Island One Managament and One Commando. Karena menurutnya, Bali sebagai pulau adalah satu kesatuan dengan daerah yang saling mendukung, untuk itu Koster berharap bisa terjadi pemerataan pembangunan dan ekonomi di seluruh Bali. “Kita akan buat branding Bali sebagai penarik wisata kita, jadi saya harap Kabupaten/Kota tidak mengembangkan brand sendiri,” cetusnya.\r\n\r\nUntuk menunjang isu pariwisata, Koster menyatakan akan membenahi sarana pendukung seperti adat-istiadat dan kebudayaan Bali, memelihara subak yang jumlahnya kian menurun akibat alih fungsi lahan, serta infrastruktur. Dari segi infrastruktur pihaknya akan mengusahakan segera dibangunnya shortcut-shortcut yang menghubungkan Bali Selatan dan Utara, serta mempercepat pembangunan Bandar Udara di Bali Utara. “Semua itu juga bertujuan untuk pemerataan pembangunan di Bali,” imbuhnya.\r\n\r\nIa menambahkan berbagai program yang akan menjadi prioritas ke depan seperti bidang pendidikan, kesehatan, sosial, ketenagakerjaan, serta lainnya akan segera ditindaklanjuti sehingga bisa rampung dalam periode lima tahun kepemimpinannya.Tak lupa dalam kesempatan itu Ia juga mengapresiasi kinerja Gubernur sebelumnya yang telah meletakkan pondasi perekonomian Bali sehingga bisa menjadi baik seperti sekarang. “Terima kasih saya ucapkan kepada bapak Made Mangku Pastika untuk kinerja sepuluh tahun ke belakang,” cetusnya.', '<div><div><h3>Sports</h3><p>sports in Ghana<br></p></div><div></div><div></div></div><br>\r\n\r\n\r\n\r\n<div><div><h3>1914 Entertainment</h3><p>\"hellooooooooooooooooo</p></div><div></div><div></div></div><br>\r\n\r\n\r\n\r\n<div><div><h3>1914 Ghana sports<br></h3><p>helooooooooooooooooooooooooooooo ghana<br></p></div><div></div><div></div></div><br>', '\r\n<p>&nbsp;</p>\r\n<div class=\"wrapper\" style=\"background-color: #f2f2f2;\">\r\n<table style=\"border-collapse: collapse; table-layout: fixed; color: #b8b8b8; font-family: Ubuntu,sans-serif;\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td class=\"preheader__snippet\" style=\"padding: 10px 0 5px 0; vertical-align: top; width: 280px;\">&nbsp;</td>\r\n<td class=\"preheader__webversion\" style=\"text-align: right; padding: 10px 0 5px 0; vertical-align: top; width: 280px;\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table id=\"emb-email-header-container\" class=\"header\" style=\"border-collapse: collapse; table-layout: fixed; margin-left: auto; margin-right: auto;\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td style=\"padding: 0; width: 600px;\">\r\n<div class=\"header__logo emb-logo-margin-box\" style=\"font-size: 26px; line-height